import Home from './Home';
// import NavBar from "./Navbar";

function App() {
  return (
    <div className="App">
    <Router>
      <Routes>
        <Route path="/Home" element={<Home />} />
      </Routes>
    </Router>

      {/* <NavBar/>
      <h1>Hello world!</h1> */}
  </div>
  );
}

export default App;
